import React from "react";

const ExpensItem = () => {
  return (
    <div>
      <div>March 28th 2022</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$294.67</div>
      </div>
    </div>
  );
};

export default ExpensItem;
